import "./App.css";
import ClockLoader from "react-spinners/ClockLoader";

function App() {
  const override = css`
    display: block;
    margin: 0 auto;
    border-color: red;
    background-color: white;
    color: red;
  `;
  return (
    <div className="App">
      <ClockLoader size={100} css={override} />
      <h1>React app</h1>
    </div>
  );
}

export default App;
